import React, { useState, useEffect } from "react";
import axios from "axios";

function Home2() {
  const [osis, setOsis] = useState([]);
  const [name, setName] = useState("");
  const [role, setRole] = useState("");
  const [age, setAge] = useState("");
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get("http://localhost:5000/api/osis")
      .then(response => {
        setOsis(response.data);
        setError(null); // Clear any previous errors
      })
      .catch(error => {
        console.error("There was an error fetching the OSIS data:", error);
        setError("There was an error fetching the data. Please try again later.");
      });
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();

    const newOsis = { name, role, age };

    axios.post("http://localhost:5000/api/osis", newOsis)
      .then(response => {
        setOsis([...osis, response.data]);
        setError(null); // Clear any previous errors
      })
      .catch(error => {
        console.error("There was an error posting the new OSIS data:", error);
        setError("There was an error adding the new OSIS member. Please try again later.");
      });

    setName("");
    setRole("");
    setAge("");
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Data Pengurus OSIS</h1>
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-6 max-w-lg mx-auto" role="alert">
          <strong className="font-bold">Error:</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      )}
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md max-w-lg mx-auto mb-6">
        <div className="mb-4">
          <input
            type="text"
            placeholder="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="number"
            placeholder="Age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded-lg hover:bg-blue-600">Add</button>
      </form>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {osis.map((o) => (
          <div key={o._id} className="bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-xl font-bold mb-2">{o.name}</h2>
            <p className="text-gray-700 mb-1">Role: {o.role}</p>
            <p className="text-gray-700">Age: {o.age}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home2;
